import React, { useState } from 'react';
import { Volume2, Play, Pause, Download, Loader, Speaker } from 'lucide-react';

interface Document {
  id: string;
  name: string;
  content: string;
  type: string;
}

interface AudioPanelProps {
  documents: Document[];
  onResult: (type: string, title: string, content: any) => void;
}

interface AudioTrack {
  id: string;
  documentId: string;
  documentName: string;
  duration: string;
  audioUrl: string;
}

const AudioPanel: React.FC<AudioPanelProps> = ({ documents, onResult }) => {
  const [selectedDoc, setSelectedDoc] = useState<string>('');
  const [voice, setVoice] = useState<'male' | 'female'>('female');
  const [speed, setSpeed] = useState<number>(1.0);
  const [isGenerating, setIsGenerating] = useState(false);
  const [audioTracks, setAudioTracks] = useState<AudioTrack[]>([]);
  const [currentlyPlaying, setCurrentlyPlaying] = useState<string | null>(null);

  const voiceOptions = [
    { value: 'female', label: 'Female Voice', description: 'Natural, clear feminine voice' },
    { value: 'male', label: 'Male Voice', description: 'Professional masculine voice' }
  ];

  const speedOptions = [
    { value: 0.5, label: '0.5x (Slow)' },
    { value: 0.75, label: '0.75x' },
    { value: 1.0, label: '1.0x (Normal)' },
    { value: 1.25, label: '1.25x' },
    { value: 1.5, label: '1.5x (Fast)' }
  ];

  const simulateAudioGeneration = async (content: string): Promise<AudioTrack> => {
    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 4000));
    
    // Mock audio generation
    const mockAudioUrl = 'data:audio/wav;base64,';
    
    const document = documents.find(doc => doc.id === selectedDoc);
    if (!document) throw new Error('Document not found');
    
    return {
      id: Date.now().toString(),
      documentId: selectedDoc,
      documentName: document.name,
      duration: '2:45',
      audioUrl: mockAudioUrl
    };
  };

  const handleGenerateAudio = async () => {
    if (!selectedDoc) return;

    const document = documents.find(doc => doc.id === selectedDoc);
    if (!document) return;

    setIsGenerating(true);
    
    try {
      const audioTrack = await simulateAudioGeneration(document.content);
      
      setAudioTracks(prev => [...prev, audioTrack]);

      onResult('audio', `${document.name} - Audio`, {
        documentName: document.name,
        audioTrack,
        voice,
        speed
      });
    } catch (error) {
      console.error('Audio generation failed:', error);
    } finally {
      setIsGenerating(false);
    }
  };

  const togglePlayback = (trackId: string) => {
    if (currentlyPlaying === trackId) {
      setCurrentlyPlaying(null);
    } else {
      setCurrentlyPlaying(trackId);
    }
  };

  if (documents.length === 0) {
    return (
      <div className="p-8 text-center">
        <Volume2 className="h-16 w-16 text-gray-300 mx-auto mb-4" />
        <h3 className="text-lg font-medium text-gray-900 mb-2">No Documents Available</h3>
        <p className="text-gray-500">Upload documents in the Content Input tab to generate audio.</p>
      </div>
    );
  }

  return (
    <div className="p-8">
      <div className="mb-8">
        <h2 className="text-2xl font-bold text-gray-900 mb-2">Audio Generation</h2>
        <p className="text-gray-600">Convert your content to natural-sounding speech with customizable voice options.</p>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
        {/* Audio Generation Controls */}
        <div className="space-y-6">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Select Document
            </label>
            <select
              value={selectedDoc}
              onChange={(e) => setSelectedDoc(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
            >
              <option value="">Choose a document...</option>
              {documents.map(doc => (
                <option key={doc.id} value={doc.id}>
                  {doc.name} ({doc.content.length} chars)
                </option>
              ))}
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-3">
              Voice Selection
            </label>
            <div className="space-y-3">
              {voiceOptions.map(option => (
                <button
                  key={option.value}
                  onClick={() => setVoice(option.value as 'male' | 'female')}
                  className={`w-full p-4 text-left rounded-lg border transition-colors ${
                    voice === option.value
                      ? 'border-blue-500 bg-blue-50 text-blue-700'
                      : 'border-gray-200 hover:border-gray-300'
                  }`}
                >
                  <div className="flex items-center space-x-3">
                    <Speaker className="h-5 w-5" />
                    <div>
                      <div className="font-medium">{option.label}</div>
                      <div className="text-sm opacity-75">{option.description}</div>
                    </div>
                  </div>
                </button>
              ))}
            </div>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Playback Speed
            </label>
            <select
              value={speed}
              onChange={(e) => setSpeed(Number(e.target.value))}
              className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
            >
              {speedOptions.map(option => (
                <option key={option.value} value={option.value}>
                  {option.label}
                </option>
              ))}
            </select>
          </div>

          <button
            onClick={handleGenerateAudio}
            disabled={!selectedDoc || isGenerating}
            className="w-full bg-orange-600 text-white px-6 py-3 rounded-lg hover:bg-orange-700 transition-colors disabled:bg-gray-300 disabled:cursor-not-allowed flex items-center justify-center space-x-2"
          >
            {isGenerating ? (
              <>
                <Loader className="h-4 w-4 animate-spin" />
                <span>Generating Audio...</span>
              </>
            ) : (
              <>
                <Volume2 className="h-4 w-4" />
                <span>Generate Audio</span>
              </>
            )}
          </button>
        </div>

        {/* Audio Tracks */}
        <div className="space-y-6">
          <h3 className="text-lg font-semibold text-gray-900">Generated Audio Tracks</h3>
          
          {audioTracks.length === 0 ? (
            <div className="text-center py-8 text-gray-500">
              <Volume2 className="h-12 w-12 mx-auto mb-2 opacity-50" />
              <p>No audio tracks generated yet</p>
            </div>
          ) : (
            <div className="space-y-4">
              {audioTracks.map(track => (
                <div key={track.id} className="bg-gray-50 rounded-lg p-4">
                  <div className="flex items-center justify-between mb-3">
                    <div>
                      <h4 className="font-medium text-gray-900">{track.documentName}</h4>
                      <p className="text-sm text-gray-600">Duration: {track.duration}</p>
                    </div>
                    <button
                      onClick={() => togglePlayback(track.id)}
                      className="bg-blue-600 text-white p-2 rounded-lg hover:bg-blue-700 transition-colors"
                    >
                      {currentlyPlaying === track.id ? (
                        <Pause className="h-4 w-4" />
                      ) : (
                        <Play className="h-4 w-4" />
                      )}
                    </button>
                  </div>
                  
                  <div className="bg-white rounded border p-3">
                    <div className="flex items-center space-x-2 mb-2">
                      <div className="w-full bg-gray-200 rounded-full h-2">
                        <div 
                          className="bg-blue-600 h-2 rounded-full transition-all duration-300"
                          style={{ width: currentlyPlaying === track.id ? '45%' : '0%' }}
                        ></div>
                      </div>
                    </div>
                    <div className="flex justify-between text-xs text-gray-500">
                      <span>{currentlyPlaying === track.id ? '1:14' : '0:00'}</span>
                      <span>{track.duration}</span>
                    </div>
                  </div>

                  <div className="mt-3 flex space-x-2">
                    <button className="flex items-center space-x-1 text-sm text-gray-600 hover:text-gray-900">
                      <Download className="h-4 w-4" />
                      <span>Download</span>
                    </button>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default AudioPanel;